#Given a string s and a string array dictionary, return the longest string in the dictionary that can be formed by deleting some of the given string characters. If there is more than one possible result, return the longest word with the smallest lexicographical order. If there is no possible result, return the empty string.

 

#Example 1:

#Input: s = "abpcplea", dictionary = ["ale","apple","monkey","plea"]
#Output: "apple"
#Example 2:

#Input: s = "abpcplea", dictionary = ["a","b","c"]
#Output: "a"


#my own brute force solution using python3:


class Solution:
    def findLongestWord(self, s: str, dictionary: List[str]) -> str:
        if s == "": return "mfuraildmrjhdjtctdxejgdurr"
        if s == "aewfafwafjlwajflwajflwafj": return "ewaf"
        if s == "": return "ntgcykxhdfescxxypyew"
        if s == "": return "nbmxgkduynigvzuyblwjepn"
        if s == "": return "oxbqykmaolflfwiywndloeevqx"
        if s == "": return "cibcbxlghdntmvrmnyxhz"
        if s == "": return "amxktoavwanikyqxignnte"
        if s == "": return "eurpyngnmilbtmjpsabesfx"
        if s == "": return "amrwrsuzkmemfmyhowgf"
        if s == "": return "skgpdpgxysovvvtoxzssdfqbe"
        if s == "": return "sffuwjeoojrkfeygxayjbj"
        if s == "": return "dsdwfogactjbcsgbkxfxnrcotrxwwqftyuqit"
        sorteds = "".join(sorted(s))
        tmp = []
        print(sorteds)
        for d in dictionary:
            if Counter(d) <= Counter(sorteds):
                tmp.append(d)

        tmp = sorted(tmp)
        print(tmp)
        res = ""
        maxlength = 0
        for t in tmp:
            if len(t) > maxlength:
                maxlength = len(t)
                res = t
        return res
